	(5, 'David Foster', 'David Foster - OF III - 3/12/2023', '\n      <p style="color: white;">\n          <p><strong>📝 Resumen:</strong></p>\n          <p><em>Sujeto en ByC por los siguientes motivos <span style="white-space: pre;">| </span></em><span style="white-space: pre; background-color: var(--color-1);">Articulo 3.8 | </span><span style="white-space: pre; background-color: var(--color-1);">Artículo 7.7 | \n\n</span><span class="selectable-text copyable-text">Unidad conformada por jefe Nick Eisenhower y OF III Foster asisten al llamado de robo de vehículo en la 10-20 del "Tequi-la-la". Se interroga al sujeto el cual responde que el vehículo es de un amigo, posteriormente se dirige a buscar al supuesto amigo escoltado por el OF. III Foster. Luego el individuo se da a la fuga y un par de cuadras después un vehículo de 4 puertas lo recoge y proceden con el artículo 7.7</span><span style="white-space: pre; background-color: var(--color-1);"><br></span></p></p>\n  ', '[]', '["(NO CALLSIGN) David Foster","(SPVSR) Nick Eisenhower"]', '["Alejandro  Gomes "]', '[]', '1701577994658', 'police');
