	(1, 'James Khaled', '254 V con disparos posteriores', '254 V', '<p>Aproximadamente a las 01:00 AM se acudio a un procedimiento de robo de vehiculo el cual genero un 254 VICTOR que dejo a dos sujetos detenidos con armamento incautado..&nbsp;</p><p>En el lugar acuden ADAM-10 compuesta por el teniente Khaled y el Cadete Ravelo y ADAM-20 compuesta por el Jefe Baker y los Cadetes Davies y Rojas</p><p>El sujeto que detiene y procesa ADAM-10 de Nombre Adam Klinton poseia un arma de fuego, se le procesa por disparos contra la policia, robo de vehiculos con intimidacion y posesion de armas.</p>', '[]', '["(NO CALLSIGN) Eduardo Ravelo","(MANDO) Tommy Baker","(NO CALLSIGN) Andrew Davies","(NO CALLSIGN) Thiago Rojas","(KING) James Khaled"]', '["Adam Klinton"]', '[]', '1701234238827', 'police');
